import 'package:auto_form_example/entities/book.dart';

Future<List<Book>> searchBook(String? query) async {
  await Future.delayed(const Duration(milliseconds: 300));

  if (query == null) {
    return [];
  }

  return fakeData.where((element) {
    return element.title.contains(query) ||
        element.pages
            .where((element) => element.content.contains(query))
            .isNotEmpty;
  }).toList();
}

